import React, { Component } from 'react';
import {
  View,
ImageBackground,
  StyleSheet,
  ScrollView,
  TextInput,
  Dimensions,
  Text,
  TouchableOpacity,
  Platform,
  Image,
  KeyboardAvoidingView,
StatusBar

} from 'react-native';

class Register extends Component {
  render(){
    return( 
       <ImageBackground source={require("./assets/money.png")} style={{width:"100%",height:"100%"}}>

    
       <ScrollView style={styles.container}>
    <KeyboardAvoidingView style={styles.containerview} behavior="padding ">

<Text style={styles.appname}>Market Day</Text>
<View 
style={{
  width:"100%",
  backgroundColor:"green",
  height:2,
  margin:30
}}
/>


<View style={{alignItems:"center",margin:"7%"}}>
<View style={{flexDirection:"row"}}>
  <Image source={require("./assets/person.png")} style={styles.image}/>
{/* <Text style={styles.text}>   E-Mail</Text> */}
</View>
<TextInput style={styles.textinput} placeholder="User Name"/>
</View>



<View style={{alignItems:"center",margin:"1%"}}>
<View style={{flexDirection:"row"}}>
  <Image source={require("./assets/emailicon.png")} style={styles.image}/>
{/* <Text style={styles.text}>   E-Mail</Text> */}
</View>
<TextInput style={styles.textinput} placeholder="E-Mail"/>
</View>


<View style={{alignItems:"center",margin:"1%"}}>
<View style={{flexDirection:"row",margin:8}}>
  <Image source={require("./assets/paswordicon.png")} style={styles.image}/>
  {/* <Text style={styles.text}>Pasword</Text> */}
</View>

<TextInput placeholder="Pasword" style={styles.textinput} secureTextEntry={true}/>
</View>


<TouchableOpacity onPress={()=>this.props.navigation.navigate("SuccessScreen")}>
  <Text style={styles.button} >Register</Text>
</TouchableOpacity>

<Text>OR</Text>

<TouchableOpacity onPress={()=>this.props.navigation.navigate("LoginScreen")}>
<Text style={styles.register}>Login</Text>
</TouchableOpacity>

    </KeyboardAvoidingView>
  </ScrollView>
   </ImageBackground>
    )
  }
}
const styles=StyleSheet.create({
  container:{
      flex:1,
// backgroundColor:"#E5E5E5", 

  },
  containerview:{
    marginTop:StatusBar.currentHeight*1.5,
alignItems:"center",  
// marginTop:20,
backgroundColor:"#fff",
height:Dimensions.get("window").height/1.1,
width:"89%",
alignSelf:"center",
borderColor:"green",
borderWidth:1,

borderRadius:50
  },
  appname:{
    color:"green",
    fontSize:22,
    fontWeight:"bold",
    paddingTop:10
  },
  text:{
fontSize:18
  },
  image:{
    height:25,
    width:30,
    // borderRadius:5
  },
  textinput:{
    borderRadius:50,
    borderColor:"gray",
    width:Dimensions.get("window").width/1.3,
    borderWidth:1,
    textAlign:"center"
  },
  button:{
      backgroundColor: 'green',
    alignSelf: 'center',
    width: Dimensions.get("window").width/1.3,
    // marginLeft: Dimensions.get('window').width /8,
    height: 35,
    borderRadius: Platform.OS==="ios" ? 17 :50,
 
    paddingTop: 6,
    fontSize: 18,
    textAlign: 'center',
    margin:20,
    color: 'white',
    overflow:"hidden"
  },
  register:{
    textAlign:"center",
    color:"green",
    fontSize:19
  }
})
export default Register
